INSERT INTO `Boards` VALUES (4,7,'TommyJR',1,0,8,22,'sound yg di mesti di ubah','358 yong ma , 370 yong kyum , 363 yong rang , 340 yong kyum , 331 suara ox 1-6 dan Z',1),(8,7,'ZapCure',1,0,8,24,'shadow skill','kok delaynya lama juga yah kaya buss kiss nyaris 1 menit',2),(13,300,'ZapCure',1,0,8,28,'buat apaan meeting board','buat apa miting board',1),(18,301,'God',1,0,9,4,'GFX commands','== Command =================================================\r\r\r*Note: \r\rNext      = \"n\"\rPrevious  = \"p\"\r\r\rEQUIP:\r------------------------------------------------------------ \rWeapon       : \"weap\"\rArmor        : \"armor\"\rShield       : \"shield\"\rBoots        : \"boots\"\rFaceAccesory : \"facea\"\rNecklace     : \"neck\"\rMantle       : \"cape\"\rHelmet       : \"helm\"\rCrown        : \"crown\"\rHair         : \"hair\"\rFace         : \"face\"\r\r\r\rCORE:\r------------------------------------------------------------\r- sound\r- spell (animation)\r- music\r- dis   (disguise)\r\r\r\r\r\r== Usage ====================================================\r\r \"nweap\" or \"pweap\"    -> Browse weapon gfx look (next/prev)\r \"weap 87\"             -> Go/jump to number 87 \r \"weap 87 4\"           -> \"4\" is weapon gfx color\r\r\r\r \"nsound\" or \"psound\"  -> Browse gfx Sound effect\r \"sound 28\"            -> Go/jump to number 28\r\r\r \"ndis\" or \"pdis\"      -> Browse gfx look for mobs/npc\r \"dis 42\"              -> Go/jump to number 42\r \"dis 42 6\"            -> \"6\" mob/npc look color\r\r\r\r-------------------------------------------------------------\r',6),(19,7,'Yumiko',0,0,9,6,'fix','telepot ke kugnae ga bs ,..\rmistik ga ada momon..\rcacing sakit.. \rnpc : deluxe buya ga ada .. sbagian goa bs masuk sebagian ngak\r',3),(20,7,'Dru',0,1,9,8,'Ress me','ini mati ga bisa di idupin? ga da silver thread..ke dukun juga ga bisa d klik npc nya hix',4),(21,301,'God',1,0,9,11,'Command for GM only','== Commands =========================================\r\r/flush     -> flush all aether / delayed spells\r\r/mobmaster -> switch to on/off (make mobs can detect you)\r\r/ww        -> Walk through the walls/object (on/off)\r\r/bc \"chat\" -> Broadcast\r\r/cspells   -> Clear/delete all spells (self) *must relog\r\r/cinv      -> Clear/delete all inventory (self)\r\r/gmc       -> GM chat channel (on/off)\r\r/res       -> Ressurection (self)\r\r/heal      -> Heal Health = maxHealth (self)\r\r/sum       [string] *target\r\r/app       [string] *target\r\r/gold      [num] *amount\r \r/state     [num] *0 = alive\r                 *1 = dead\r                 *2 = invisible\r                 *3 = mount\r                 *4 = disguise\r\r/speed     [num] *0 = fastest\r\r/s         [num/string] *spell.id / spell.yname\r\r/i         [num/string] *item.id / item.yname\r\r/level     [num] *amount\r\r/hair      [num(, num)] *number of hair,  color\r\r/face      [num(, num)] *number of hair,  color\r\r/silence   [string] *target\r\r/warp      [num(, num(, num))] * map.id, x, y\r\r',7),(22,7,'IDLEEEE',0,0,9,12,'Skill Steed','skill steednya error, sekali di pakai keluar satu. tapi pas di tekan R dia keluar lagi. malah tambah banyak kudanya\rkudanya pun tak bisa di pukul\r',5),(23,8,'Mosessio',0,0,9,15,'Menyelamatkan Chu rua','- Permulaan quest di ambil dari Jade spear setelah mencapai level minimal di atas lv.5 , pilih opsi setuju untuk membantu.\r\r- Kamu akan di pindahkan ke TKP dimana seekor kura2 tolol di hadapanmu sekitar koor (62, 48) klik kura2 tsb.\r\r- Temui Kelinci di sekitar (54, 30). katakan \"Hello\" kemudian katakan \"Ginseng\"\r\r- Temui Batu keramat di (66, 05) <<- ntah ada maksud batu keramat ini. tak ada sangkut paut sebenarnya.. Ikuti aja lah\r\r- Temui macan sok jago di (14, 8) katakanlah \"Rabbit\" atau \"Kelinci\"\r\r- Sebuah Ginseng akan jatuh di pinggir tebing sebelah kiri / barat. Ambil ginseng tsb.\r\r- Temui chu rua kembali dengan membawa ginseng tsb. Dan si kura2 tolol itu telah mendapatkan ginseng nya kembali! Hore\r\r\r\r\rHadiah :\r- Sejumlah EXP\r- 5000 koin\r- 1 Cincin Lautan (Sea Ring)\r- Legenda Menyelamatkan Chu Rua\r\r\r\r\r',1),(24,1,'God',1,0,9,19,'Mythic I opened!','Seluruh tempat hunting yang ada di Mythic I sudah dapat di akses\rtermasuk Mythic I naga.\r',1),(25,1,'God',1,0,9,19,'Quest Updated!','Quest Menyelamatkan Chu rua sudah dapat di ambil.\rSyarat Min level 6. (telah menyelesaikan quest tutor)\rLokasi pengambilan quest di Jadespear buya.',2),(26,1,'God',1,0,9,19,'Monster Update!','Monster Mythic I oleh GM Zapcure dalam proses.\r\rkejar sajah dia biar cepet di selesaikan =P',3),(28,1,'God',1,0,9,24,'Ability','- Sheperd     @Forest (130, 101)\r- Ore Mining  @Forest (211, 32)\r- Gem Mining  @Forest (216, 107)\r- Weaving     @Forest (44, 30)\r- Gem Cutting @Forest (46, 40)\r\r',4),(29,1,'God',1,0,9,26,'Maps updated!','New map \'Artic Land\' & \'Ice cave\' @market\r',5),(30,7,'Ochobot',0,0,10,1,'soothe','sote ga bisa heal\rlayhand ga cukup mana',6),(31,8,'Sanji',0,0,10,1,'Rescurection by Dukun','apabila ad player yang mati\r\rtekan f1.. akan muncul menu ke Dukun\r\rdan anda akan hidup kembali\r\rHorassss ^^',2),(32,8,'Sanji',0,0,10,2,'HeLping Deludge Revenge','Requirements :\r- Minimum level 25\r\rpergi ke selatan buya \rkoor X 118 Y 134\r\rlalu masuk ke rumah yg ada di atas gua rubah. \rKlik npc berbaju hitam yg akan memintamu membunuh rubah ekor 9 dan mengambil drop dr monster tersebut.\r\rPilih \'tentu saja\'.\r\rpergilah ke gua rubah koor X 125 Y 144 \rlalu bunuh rubah ekor 9 dan ambil ekor rubah 9  ( monster biasa terdapat di room 3 ) . \r\rsetelah itu kembali ke rumah npc tsb utk mendapatkan sejumlah karma, Legend mark ( Helping deludge revenge) dan Pedang Do.\r\r\rmYnexia',3);
